export class AppComponent {
  title = 'dashboard';
}
<div class="app-wrapper">
  <div class="top-section">
    <h1>19:00</h1>
    <h2>1 January 2024</h2>
  </div>
  <div class="containent-section">
    <router-outlet></router-outlet>
  </div>
  <div class="bottom-section">
    <app-tabs></app-tabs>
  </div>
</div>
